import React from 'react';

function NotFound() {
  return (
    <div style={{ color: '#fff', textAlign: 'center', marginTop: '100px', fontFamily: '"Press Start 2P", monospace' }}>
      <h1>404</h1>
      <p>Page Not Found</p>
    </div>
  );
}

export default NotFound;
